import React from 'react';

const aboutStyle = `
.about-container {
  margin-top: 100px;
}
`;

const About = () => {
  return (
    <div className="about-container">
      <h1>Front End Engineer with Back End Experience</h1>
      <style>{aboutStyle}</style>
    </div>
  );
};

export default About;
